[5]: Minutes when temperature in range [15..19] Celsius degrees.
[6]: Minutes when temperature in range [20..24] Celsius degrees.
[7]: Minutes when temperature in range [25..29] Celsius degrees.
[8]: Minutes when temperature in range [30..34] Celsius degrees.
[9]: Minutes when temperature in range [35..39] Celsius degrees.
[10]: Minutes when temperature in range [40..44] Celsius degrees.
[11]: Minutes when temperature in range [45..49] Celsius degrees.
[12]: Minutes when temperature in range [50..54] Celsius degrees.
[13]: Minutes when temperature in range [55..59] Celsius degrees.
[14]: Minutes when temperature in range [60..64] Celsius degrees.
[15]: Minutes when temperature in range [65..69] Celsius degrees.
[16]: Minutes when temperature greater than 70 Celsius degrees.

