INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_BATTERYBACKUP_V',7,'pmBatteryDischargeTimeDistr','counter','INT64','PDF','Distributed durations of battery discharges. 
