INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_BATTERYBACKUP_V',9,'pmBatteryDepthOfDischargeDistr','counter','INT64','PDF','Distribution of battery depth of discharge (DoD). 
