INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_IPACCESSHOSTET',9,'pmIpInHdrErrors','counter','INT64','PEG','The number of received packets discarded due to errors in the IP header, that is:
