INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_IPACCESSHOSTET',29,'pmUdpInDatagrams','counter','INT64','PEG','The number of received UDP datagrams delivered to higher level protocol/user, including datagrams received during session release.

