INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_IPACCESSHOSTET',30,'pmUdpInErrors','counter','INT64','PEG','The number of received UDP datagrams that could not be delivered for reasons other than the lack of an application at the destination port, that is:
