INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_ENODEBFUNCTION',10,'pmMoFootprintMax','counter','INT64','GAUGE','This counter specifies the current footprint in the eNB from the configured MO instances for all different Cell Relations and External Cells in relation to the MO system limit. The higher the value, the more internal memory is consumed in the eNB for MO instances for the different types of Cell Relations and External Cells. The value is the highest sampled value during a ROP period. When the value reaches 100, further creation attempts for MO instances are rejected.','0','ENodeBFunction','pmMoFootprintMax');
