INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_ENODEBFUNCTION',20,'pmLicDlCapLicense','counter','INT64','GAUGE','The licensed capacity limit for downlink baseband capacity. The value reflects the capacity value in the license key file, that is the value of the attribute licensedCapacity in the DlBasebandCapacity instance of the MO class CapacityFeatureLicense.

