INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_EUTRANCELLFDD_V',9,'pmPdcpVolDlCmpHdrQci','counter','INT64','PDF','The total volume of compressed PDCP SDU headers that has been transmitted from the Robust Header Compression entity in the downlink direction per QCI.

