INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_EUTRANCELLFDD_V',58,'pmCaConfiguredDlFddTddSum','counter','INT64','PDF','Number of configured downlink SCells identified by duplex mode, for UEs that use this cell as their PCell. Only one bin is pegged for each UE and sample, based on all configured SCells when the counter is updated. For example, for a UE configured with one FDD and one TDD SCell, only bin 8 is incremented and not bin 0 or bin 4.

PDF ranges:
[0]: Number of carrier aggregation-capable UEs that are configured with one FDD SCell.
[1]: Number of carrier aggregation-capable UEs that are configured with two FDD SCells.
[2]: Number of carrier aggregation-capable UEs that are configured with three FDD SCells.
[3]: Number of carrier aggregation-capable UEs that are configured with four FDD SCells.
[4]: Number of carrier aggregation-capable UEs that are configured with one TDD SCell.
[5]: Number of carrier aggregation-capable UEs that are configured with two TDD SCells.
[6]: Number of carrier aggregation-capable UEs that are configured with three TDD SCells.
