INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_EUTRANCELLTDD',7,'pmRadioCalibAttFail','counter','INT64','PEG','The Counter is incremented every time a calibration attempt is unsuccessful. A set of measurements are preformed every calibration occasion. If the calibration is successful or not is determined by two tests:

1: A test to check if the level of the received calibration measurement signal is to low.

2: A test to check if the signal is disturbed or corrupted in a way that it is not possible to estimate the calibration parameters.

If at least one of the tests are failing the calibration is considered unsuccessful and the counter is incremented. If calibration is unsuccessful a new calibration attempt is immediately started. After several unsuccessful calibration attempts an alarm is issued.','0','EUtranCellTDD','pmRadioCalibAttFail');
