INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_EUTRANCELLTDD_V',55,'pmCaActDlIeNbSum','counter','INT64','PDF','Number of activated DL inter-eNodeB (IeNb) external SCells (ESCells) of any duplex mode, for UEs that use this cell as their PCell. Inter-eNodeB carrier aggregation interactions can be through the IeNB-CA feature or the Elastic RAN feature.

PDF ranges:
[0]: Number of carrier aggregation-configured UEs that have no activated ESCells.
[1]: Number of carrier aggregation-configured UEs that have one activated ESCell.
[2]: Number of carrier aggregation-configured UEs that have two activated ESCells.
