[4]: Number of carrier aggregation-configured UEs that have four activated ESCells.','0','EUtranCellTDD','pmCaActDlIeNbSum');
INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_EUTRANCELLTDD_V',56,'pmCaConfiguredDlIeNbSum','counter','INT64','PDF','For inter-eNodeB (IeNb) carrier aggregation interactions, records the number of configured DL external SCells (ESCells) of any duplex mode, for UEs that use this cell as their PCell. Inter-eNodeB carrier aggregation interactions can be through the IeNB-CA feature or the Elastic RAN feature.

PDF ranges:
[0]: Number of carrier aggregation-capable UEs that are not configured with any ESCell. Includes CA capable UEs possibly configured with local SCells.
[1]: Number of carrier aggregation-capable UEs that are configured with one ESCell.
[2]: Number of carrier aggregation-capable UEs that are configured with two ESCells.
[3]: Number of carrier aggregation-capable UEs that are configured with three ESCells.
[4]: Number of carrier aggregation-capable UEs that are configured with four ESCells.','0','EUtranCellTDD','pmCaConfiguredDlIeNbSum');
INSERT INTO persistence_entity_columns VALUES ('PM_E_ERBS_L17B','L17B','PM_E_ERBS_EUTRANCELLTDD_V',57,'pmCaScheduledDlIeNbSum','counter','INT64','PDF','For inter-eNodeB (IeNb) carrier aggregation interactions, records the mean number of UEs that have data scheduled on a DL external SCell (ESCell), counted by the number of component carriers hosted on external eNodeBs and simultaneously scheduled.
UE is considered scheduled for carrier aggregation if the eNodeB has sent a PDCCH assignment indicating a PDSCH assignment. Inter-eNodeB carrier aggregation interactions can be through the IeNB-CA feature or the Elastic RAN feature.

PDF ranges:
